DROP TABLE IF EXISTS Airlines;

CREATE TABLE Airlines(
   AirlineID        INTEGER NOT NULL
  ,AirlineName      VARCHAR(81) NOT NULL
  ,Alias            VARCHAR(30)
  ,IATA             VARCHAR(3)
  ,ICAO             VARCHAR(5) PRIMARY KEY
  ,Callsign         VARCHAR(50)
  ,Country          VARCHAR(37)
  ,Active           VARCHAR(1) NOT NULL
);

